import { Icon } from "@iconify/react";
import React from "react";
import { Col, Row } from "react-bootstrap";
// import { Container } from "react-bootstrap";

const About = () => {
  return (
    <div className="box">
      <div style={{ marginTop: "150px " }} id="About">
        <div
          style={{ "margin-bottom": "30px" }}
          className="about-logo text-center"
        >
          <span style={{ "font-size": "30px" }}>About me</span>
        </div>
        <Row>
          <Col xl={6}>
            <div className="about-img">
              <img src="./Images/My-img.jpg" className="logo" alt="pc" />
            </div>
          </Col>
          <Col xl={6}>
            <div className="about-info">
              <h5>
                Hello, I'm Shubham Chikhale, a recent graduate in BBA(CA) with a
                keen interest in Front-end Development and React. I have
                completed several online courses and have hands-on experience in
                creating web applications using React.
                mail me on shubhamchikhale4@gmail.com
              </h5>
              <div style={{ marginTop: "20px" }} className="Projects">
                <a href="#Projects" className="nav-logo bbttn">
                  Projects
                  <Icon icon="ic:baseline-play-arrow" />
                </a>
              </div>
            </div>
          </Col>
        </Row>
      </div>
    </div>
  );
};

export default About;
